import React from 'react';

import Button from 'react-bootstrap/Button';

function Landing() {
  return (
    <div center="true">
      <Button variant="link" href="/student">Student</Button>
      <Button variant="link" href="/instructor">Instructor</Button>
    </div>
  );
}
